import { useState } from 'react';
import './filter.scss';
import useFilter from './usefilter';

const Filter = () => {
    const [term, setTerm] = useState("");
    //const [todos] = useFilter("https://jsonplaceholder.typicode.com/todos")
    const [todos] = useFilter("https://flight-a262e-default-rtdb.firebaseio.com/maintainer.json")
    // const [todos] = useFilter("https://partner.imwallet.in/web_services/statudentFilter.jsp")
  const list = todos
    .filter((filt) => filt.flight.search(term)>=0 || filt.price.search(term) );

  return (
    <div>
      <h1>Filter Todos</h1>
      <div className='filter'>
      <input
        type="text"
        value={term}
        onChange={(e) => setTerm(e.target.value)}
        placeholder="search"
      />
      </div>
      {list.map((user) => (
        <div key={user.id} className='items'>
          <table>
            <tr>
           <td>{user.from}</td>
           <td>{user.departure}</td>
           <td>{user.flight}</td>
           <td>{user.to}</td>
           <td>{user.arrival}</td>
           <td>{user.price}</td>

            </tr>
          </table>
        </div>
      ))}
    </div>
  );
};
export default Filter;
